import React from 'react'
import { useParams } from 'react-router-dom'
import './Chat.css'

function Chat() {
    const {id} = useParams()
    return (
        <div className='chat'>
            <h2>Your Are In  Chat Room</h2>
        </div>
    )
}

export default Chat
